/* SE 3.0 이하 태깅 상품 툴팁 내용 */
.se_point_tag_tooltip.position-top-left .tag_item_box { top: 15px; left: -15px; }
.se_point_tag_tooltip.position-top-right .tag_item_box { top: 15px; right: -16px; left: auto; }
.se_point_tag_tooltip.position-middle-right .tag_item_box { top: 15px; right: -16px; left: auto; }
.se_point_tag_tooltip.position-bottom-left .tag_item_box { top: auto; bottom: 15px; left: -15px; }
.se_point_tag_tooltip.position-bottom-center .tag_item_box { top: auto; bottom: 15px; left: -15px; }
.se_point_tag_tooltip.position-bottom-right .tag_item_box { top: auto; bottom: 15px; right: -16px; left: auto; }
.se_point_tag_tooltip .tag_item_box { position: absolute; top: 15px; left: -15px; width: 306px; height: 106px; background-color: #ffffff; }
.se_point_tag_tooltip .item_link { display: table; width: 100%; table-layout: fixed; }
.se_point_tag_tooltip .mask { display: table-cell; width: 106px; height: 106px; vertical-align: middle; }
.se_point_tag_tooltip .thumb { overflow: hidden; position: relative; height: 100%; }
.se_point_tag_tooltip .thumb .thumb_img {position: absolute; margin: auto; top: -100%; bottom: -100%; left: -100%; right: -100%; width: 100%; }
.se_point_tag_tooltip .thumb:after { position: absolute; top: 0; left: 0; right: 0; bottom: 0; border: solid 1px rgba(0, 0, 0, 0.05); content: ''; }
.se_point_tag_tooltip .thumb.noimage, .se_point_tag_tooltip .thumb.shield, .se_point_tag_tooltip .thumb.adult { background-color: #f7f8fa; }
.se_point_tag_tooltip .thumb.noimage:before, .se_point_tag_tooltip .thumb.shield:before, .se_point_tag_tooltip .thumb.adult:before { position: absolute; top: 0; right: 0; bottom: 0; left: 0; margin: auto; background: url(./img/ss/sp_se_product_tagging.png) no-repeat; background-size: 300px auto; -webkit-background-size: 300px auto; content: ''; }
.se_point_tag_tooltip .thumb.noimage:before { background-position: 0 0; width: 40px; height: 58px; }
.se_point_tag_tooltip .thumb.shield:before { background-position: -110px 0; width: 50px; height: 52px; }
.se_point_tag_tooltip .thumb.adult:before { background-position: -50px 0; width: 50px; height: 50px; }
.se_point_tag_tooltip .info { display: table-cell; padding: 0 24px 0 17px; text-align: left; vertical-align: middle; }
.se_point_tag_tooltip .info .price { display: block; margin-bottom: 8px; font-size: 15px; font-weight: bold; color: #242424; }
.se_point_tag_tooltip .info .won { font-weight: normal; }
.se_point_tag_tooltip .info .text { display: block; overflow: hidden; -o-text-overflow: ellipsis; text-overflow: ellipsis; line-height: 20px; display: -webkit-box; max-height: 40px; white-space: normal; word-wrap: break-word; word-break: keep-all; -webkit-line-clamp: 2; -webkit-box-orient: vertical; word-break: break-all; height: 40px; font-size: 13px; color: #888888; }
.se_point_tag_tooltip .info .text:only-child { height: auto; }
